import { Injectable } from "@angular/core";
import { Student } from "./student.model";
const students =
   [{ id: 1, name: "fghj", phon: "13456", family: "jk", addres: "hjk 5", avg: 89,,active:true tests: [{ code: 1, date: new Date(), description: "jkk" ,mark:90}, { code: 2, date: new Date(), description: "yy",mark:90 }] }, { id: 2, name: "fgk", phon: "1345678956", family: "hjkjk", addres: "hjk 9", avg: 100}];

@Injectable()
export class studentService {
   getStudents(): Student[] {
      return students;
   }

   getStudentsAfterSeconds(): Promise<Student[]> {
      return new Promise((res, rej) => {
         setTimeout(() => {
            res(students);
         }, 3000)
      });
   }
}
